export default function SearchBar(props) {
   return (
      <div className={style.SearchBar}>
      <input type='search' className={style.SearchInput}/>
      <button className={style.SearchButton}
       onClick={(id) => {
         onSearch(id);
       }}
       >Agregar
       </button>
      </div>
   );
}
